import React, { useState } from "react";
import Logo from '../istockphoto-981368726-170667a.jpg';
import logoutUser from "../services/logoutUser.js"
import { Navigate } from "react-router-dom";


const Header = () => {
    const [userLogged, setUserLogged] = useState(window.localStorage.getItem('logedUserMenuApp'))

    return (
        <div className="App-header">
            <div className="App-header-title" >
                <img className="App-header-logo" src={Logo} alt="Logo" />
                <h2>Restaurant Name</h2>
                <a className="App-header-logout App-link" onClick={logoutUser()} href="/">Log out</a>
            </div>
            {userLogged && <Navigate to="/" replace={true} />}
        </div>
    )
}

export default Header;
